func ErrorStrings() []string {
	strs := make([]string, len(_ErrorNames))
	copy(strs, _ErrorNames)
	return strs
}

// IsAError returns "true" if the value is listed in the enum definition. "false" otherwise
func (i Error) IsAError() bool {
	_, ok := _ErrorMap[i]
	return ok
}
